import React from "react";
import NavBar from "./NavBar";

function Chat() {
  return (
    <div>
      <NavBar />
      <div id="ChatDiv">
        <div id="DmName"></div>
        <div id="messageContainer"></div>
        <div id="WriteCommentContainer">
          <textarea
            id="addCommentInput"
            type="text"
            placeholder="Enter Comment"
            ref={commentRef}
          />
          <img
            id="submitComment"
            src={submitIcon}
            onClick={SubmitComment}
            alt="Submit"
          />
        </div>
      </div>
    </div>
  );
}

export default Chat;
